angular.module("ImageEditor").factory("localStorage",function(){var e={expireAfter:2,get:function(t){var i=JSON.parse(localStorage.getItem(t));return i&&e.isValid(i.time)?i.value:!1},set:function(e,t){var i={value:t,time:(new Date).getTime()};return localStorage.setItem(e,JSON.stringify(i))},isValid:function(t){var i=((new Date).getTime()-new Date(t).getTime())/864e5;return i<e.expireAfter}};return e});